const CsvGeneration = () => {
    // Declare a new state variable, which we'll call "count"
    //   const [count, setCount] = useState(0);

    return (
        <SimpleFlexWrapper top="30px">
            <WrapAreas>
                <SimpleFlexWrapper justify="space-between">
                    <InputText />
                    <InputText />
                    <InputText />
                </SimpleFlexWrapper>
            </WrapAreas>
        </SimpleFlexWrapper>
    );
}

export { CsvGeneration };
